const AppLayout = () =>{
    return(
         <React.Fragment>
           <Header />
           <Body />
           <Footer />
         </React.Fragment> 
          
            
    );
};

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(<AppLayout />);



   
